function MoreInfo(props){
console.log(props);
    function hanldeClick(){
        props.close('')
      
    }
    
   return(
       <article>
         <h4>{props.data.description}</h4>
           <p> {props.data.targets[0].title}</p>
          {props.data.targets}
         
        
            <button onClick ={hanldeClick}>Close</button> 
       </article>
   )

}

export default MoreInfo;
